import React from 'react';

function NavBar() {
  return (
    <div className='container'>
      <div className='d-flex justify-content-between align-items-center'>
        <div >
          <img className='h-22 w-25' src='https://getlogo.net/wp-content/uploads/2020/04/bookmyshow-logo-vector.png' alt='logo' />
        </div>
        <div className='flex-grow-1 mx-3'>
          <input
            type='search'
            className='form-control'
            placeholder='Search movies, events'
          />
        </div>
        <div>
          <h2 className='text-end'>Location</h2>
        </div>
        <div>
        <button className='bg-[#50d71e] ml-10 h-8 w-20 rounded-lg'>SignIn</button>
        </div>
      </div>
      <style>
        {`
          @media (max-width: 576px) {
            .text-end {
              text-align: center;
            }
            .mx-3 {
              margin: 0 10px;
            }
          }
        `}
      </style>
    </div>
  );
}

export default NavBar;
